                "_id": 3031315,
                "Name": "Reductio ad Absurdum",
                "Desc": "Apart from Follow-Up ATKs, all other kinds of DMG dealt by allies can also accumulate progress equal to <color style='color:#f29e38;'>18%</color> of the original DMG amount."
